import { useDispatch } from "react-redux"
import { Link, useNavigate } from "react-router-dom"

function SideBar(){
    const navigate=useNavigate()
    const dispatch=useDispatch()
    const role=sessionStorage.getItem("role")
    console.log("Role ",role)

    const logout=()=>{
        dispatch({type:'LogOut'})
        sessionStorage.clear();
        navigate("/");
    }
    return(
<div className="list-group list-group-flush">
    {role==="Admin" ? (<>
        <Link to="/dashboard" className="list-group-item list-group-item-action p-2 text-left">Dashboard</Link>                                                                                                
        <Link to="/customers" className="list-group-item list-group-item-action p-2 text-left">Customers</Link>
        <Link to="/open" className="list-group-item list-group-item-action p-2 text-left">Open Account</Link>  
        <Link to="/kyc" className="list-group-item list-group-item-action p-2 text-left">KYC</Link>                                               
        <Link to="/accounts" className="list-group-item list-group-item-action p-2 text-left">Accounts</Link>                                                                                         
        <Link to="/breport" className="list-group-item list-group-item-action p-2 text-left">Bank Report</Link>                                                
        </>):(
            <>
        <Link to="/chome" className="list-group-item list-group-item-action active">Home</Link>
        <Link to="/beneficiary" className="list-group-item list-group-item-primary">Beneficiary</Link>
        <Link to="/otransfer" className="list-group-item list-group-item-action p-2 text-left">Transfer</Link>
        <Link to="/deposit" className="list-group-item list-group-item-action p-2 text-left">Deposit</Link>
        <Link to="/cheque" className="list-group-item list-group-item-action p-2 text-left">Cheque Book</Link>    
        <Link to="/thistory" className="list-group-item list-group-item-action p-2 text-left">History</Link>
    </>)}
    <Link to="/changepwd" className="list-group-item list-group-item-action p-2 text-left">Change Password</Link>
    <button onClick={()=>logout()} className="btn-link list-group-item list-group-item-action p-2 text-left">Logout</button>
</div>
    )
}

export default SideBar;
